import React, {useState} from 'react';
import axios from 'axios';
export default function CallMira(){
  const [phone,setPhone] = useState('');
  const [date,setDate] = useState('');
  const [time,setTime] = useState('');
  const [title,setTitle] = useState('Meeting');

  async function create(){
    try{
      const res = await axios.post('http://localhost:8080/api/webhook/create', { phoneNumber: phone, date, time, title });
      alert('Created: ' + JSON.stringify(res.data));
    }catch(err){
      alert('Error: '+ err.response?.data?.error || err.message);
    }
  }

  async function reschedule(){
    const eventId = prompt('Event ID to reschedule');
    if(!eventId) return;
    try{
      const res = await axios.post('http://localhost:8080/api/webhook/reschedule', { phoneNumber: phone, eventId, newDate: date, newTime: time });
      alert('Rescheduled: ' + JSON.stringify(res.data));
    }catch(err){
      alert('Error: '+ err.response?.data?.error || err.message);
    }
  }

  async function cancel(){
    const eventId = prompt('Event ID to cancel');
    if(!eventId) return;
    try{
      const res = await axios.post('http://localhost:8080/api/webhook/cancel', { phoneNumber: phone, eventId });
      alert('Cancelled: ' + JSON.stringify(res.data));
    }catch(err){
      alert('Error: '+ err.response?.data?.error || err.message);
    }
  }

  return (
    <div className="container">
      <h2>Call Mira (Test Webhooks)</h2>
      <div className="card small">Use this UI to test create/reschedule/cancel for the calendar linked to a phone number.</div>
      <label>Phone number</label><br/>
      <input className="input" value={phone} onChange={e=>setPhone(e.target.value)} />
      <br/><br/>
      <label>Date (YYYY-MM-DD)</label><br/>
      <input className="input" value={date} onChange={e=>setDate(e.target.value)} />
      <br/><br/>
      <label>Time (HH:mm)</label><br/>
      <input className="input" value={time} onChange={e=>setTime(e.target.value)} />
      <br/><br/>
      <label>Title</label><br/>
      <input className="input" value={title} onChange={e=>setTitle(e.target.value)} />
      <br/><br/>
      <button className="btn" onClick={create}>Create Event</button>&nbsp;
      <button className="btn" onClick={reschedule}>Reschedule Event</button>&nbsp;
      <button className="btn" onClick={cancel}>Cancel Event</button>
    </div>
  );
}
